import { useEffect, useState } from "react";
import "./Livro.css";
import axios from "axios";


function Livro() {
    

    const [Livros, setLivros] = useState(["oi"]);

    useEffect(() => {
        axios.get("http://localhost:8080/teste/1/").then((resposta) => {console.log(resposta)}).catch((error) =>{
            console.log(error);
          })
      }, [])

    return(

        <h1>{Livros}</h1>

     );
}

export default Livro;
